import { useEffect,useState } from 'react';

const Effect = () => {
    let[value,setValue]=useState("use effect hooked")
    useEffect(()=>{console.log('useEffect worked');},[])
    return ( 
        <div className="effect">
            <h1>{value}</h1>
            <button onClick={()=>setValue("updated")}>Modify</button>
        </div>
     );
}
 
export default Effect;
